// Search.js
import React, { useState } from "react";
import Result from "./Result";
import "./index.css";

const Search = () => {
  const [img, setImg] = useState("");

  const inputEvent = (e) => {
    const data = e.target.value;
    setImg(data);
  };

  return (
    <div className="search">
      <input
        type="text"
        placeholder="Search"
        value={img}
        onChange={inputEvent}
        className="input"
      />
      <Result name={img} />
    </div>
  );
};

export default Search;
